webpackJsonp([21,426],{22:function(e,t){e.exports="data:image/png;base64,"},24:function(e,t){e.exports="data:image/png;base64,"},1594:function(e,t,l){e.exports={frontmatter:l(605),content:l(2775)}},2775:function(e,t,l){e.exports="<section class=intro id=introduksjon> <h1 class=intro id=introduksjon>Introduksjon</h1> <p>I dette spillet inspirert av historien om King Kong, skal vi se hvor lett det er å bruke grafikk som ikke allerede ligger i Scratch-biblioteket. I spillet styrer vi King Kong som må passe seg for flyene som angriper ham.</p> <figure><img src="+l(3508)+' alt=""></figure> </section> <section class=activity id=steg-1-hente-grafikk-fra-nettet> <h1 class=activity id=steg-1-hente-grafikk-fra-nettet>Steg 1: Hente grafikk fra nettet</h1> <p>Vi skal først se på hvordan vi kan hente bilder og figurer fra nettet og bruke dem i våre egne spill. Til dette spillet trenger vi en skyskraper, et fly og en gorilla.</p> <section class=check id=sjekkliste> <h2 class=check id=sjekkliste>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_0><label for=cbx_0> Åpne en ny fane i nettleseren din og gjør et søk, for eksempel etter <code>skyscraper icon</code>. Velg gjerne <em>Bildesøk</em> eller lignende for å bare se søkeresultatene som er bilder.</label></p> <p>Finn en skyskraper som du liker. Velg deretter <em>Se bildet</em> for å få bildet i full størrelse. Høyreklikk på bildet og velg <em>Lagre bildet som</em> og lagre det på din datamaskin et sted du finner det igjen.</p> </li> </ul> <section class=protip id=tips-for-soking> <h3 class=protip id=tips-for-soking>Tips for søking</h3> <ul> <li> <p>Når du søker etter bilder er det best å søke på engelsk fordi det er det mest brukte språket på internett.</p> </li> <li> <p>For å finne grafikk i stedet for bilder kan det være lurt å ta med ord som <code>icon</code>, <code>pixel</code> eller <code>drawing</code> i søket ditt.</p> </li> <li> <p>De fleste søkemotorene har også muligheten for å gjøre <em>avansert bildesøk</em>. Da kan du som regel begrense søket til å bare lete etter tegninger eller tilsvarende.</p> </li> </ul> </section> </section> <section class=check id=sjekkliste-2> <h2 class=check id=sjekkliste-2>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_1><label for=cbx_1> Søk også opp figurer for fly og King Kong.</label></p> <p>Her er noen eksempler, men bruk gjerne bilder du finner selv:</p> <figure><img src='+l(3506)+' alt=""></figure> <p>Skyskraper fra <a href=http://www.iconarchive.com/show/home-sweet-home-icons-by-iconka/Home-Skyscraper-icon.html>www.iconka.com</a>, fly fra <a href=http://hellraz3r.deviantart.com/art/Plane-Pixel-Art-193480982>hellraz3r.deviantart.com</a> og King Kong fra <a href=http://www.flaticon.com/free-icon/small-monkey-with-long-tail_28726>www.freepik.com</a>.</p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_2><label for=cbx_2> Etter at du har lastet ned bildene fra nettet er det på tide å ta dem inn som nye figurer i Scratch. Gå tilbake til Scratch. Klikk på <img src='+l(24)+' alt="Last opp figur fra fil"> ved siden av <strong>Ny figur</strong> og velg et av bildene du har lastet ned. Gjør det samme med de andre bildene, slik at du har tre figurer, en skyskraper, et fly og en King Kong-figur.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_3><label for=cbx_3> Figurene får navn fra bildefilene. Endre gjerne navnet på figurene i figurlisten til <code>skyskraper</code>, <code>fly</code> og <code>kong</code> slik at det blir enklere å holde oversikten.</label></p> </li> </ul> <section class=protip id=hvilke-bilder-kan-du-bruke> <h3 class=protip id=hvilke-bilder-kan-du-bruke>Hvilke bilder kan du bruke?</h3> <p>Når du henter bilder fra nettet bør du sjekke at du har tillatelse til å bruke dem. Selv om bilder ligger på Internett betyr ikke det at du kan kopiere dem og bruke de som du selv vil!</p> <p>Mange bilder har en <em>lisens</em> som sier at andre kan bruke dem. Dette står ofte på nettsiden i nærheten av bildet (på samme måte som det står Lisens nederst i denne oppgaven). Vanligvis vil de som eier bildet at du forteller at du har kopiert bildet fra dem. Dette er veldig lett i Scratch, da man kan skrive hvor bildene kommer fra på Prosjektsiden under <em>Merknader og Bidragsytere</em>.</p> </section> </section> </section> <section class=activity id=steg-2-tegn-litt-selv> <h1 class=activity id=steg-2-tegn-litt-selv>Steg 2: Tegn litt selv</h1> <p>Like morsomt som å finne bilder på nettet er det å tegne litt selv.</p> <section class=check id=sjekkliste-3> <h2 class=check id=sjekkliste-3>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_4><label for=cbx_4> La oss først tegne en enkel bakgrunn. Klikk på <img src='+l(22)+' alt="Tegn ny bakgrunn"> ved <strong>Ny bakgrunn</strong> nederst til venstre.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_5><label for=cbx_5> Velg Malingsbøtte-verktøyet (<em>Fyll med farge</em>) for å fargelegge bakgrunnen. Finn et par fine himmelfarger, for eksempel en overgang fra blå øverst til noe lysere nederst. Klikk på bakgrunnen slik at den blir fargelagt.</label></p> <figure><img src='+l(3510)+' alt=""></figure> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_6><label for=cbx_6> For en litt enkel gresseffekt skal vi nå velge <em>Rektangel</em>-verktøyet, og en helt svart farge. Tegn et svart rektangel på den nederste delen av bakgrunnen.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_7><label for=cbx_7> Velg så en ganske lys grønn farge og tegn et grønt rektangel som dekker det meste av det svarte rektangelet, slik at det blir en svart strek mellom gresset og himmelen.</label></p> <figure><img src='+l(3507)+' alt=""></figure> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_8><label for=cbx_8> Velg deretter en litt mørkere grønn farge, og tegn et nytt grønt rektangel som dekker den nedre delen av det forrige rektangelet. Gjenta dette med stadig mørkere grønnfarger til du har et passende antall striper som forestiller gresset. Se <a href=#introduksjon>øverst i oppgaven</a> for et ferdig eksempel.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_9><label for=cbx_9> Du kan også tegne litt på figurene du har lastet ned. For eksempel, om du lastet ned skyskraperen fra lenken over er den gjennomsiktig! Det ser litt rart ut. Det blir bedre om du velger en farge og fargelegger skyskraperen!</label></p> </li> </ul> <p>Til spillet vårt vil vi behøve to drakter til <strong>King Kong</strong>. En drakt der han står på venstre side av skyskraperen og en der han står på høyre side.</p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_10><label for=cbx_10> Klikk på <code>kong</code>-figuren og velg <code>Drakter</code>-fanen. Høyreklikk på <code>kong</code>-drakten og velg <code>Lag en kopi</code>.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_11><label for=cbx_11> Klikk på kopien og bruk knappen <img src='+l(3466)+' alt="" title="Speilvend\nhøyre-venstre"> i øverste høyre hjørne til å speilvende denne nye drakten.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_12><label for=cbx_12> Gi de to draktene navnene <code>Høyre</code> og <code>Venstre</code>.</label></p> </li> </ul> <section class=protip id=utforsk-tegneverktoyene> <h3 class=protip id=utforsk-tegneverktoyene>Utforsk tegneverktøyene</h3> <p>Prøv gjerne de forskjellige tegneverktøyene på egen hånd. Vet du hva alle gjør?</p> <p>Legg merke til at nede i høyre hjørnet velger du mellom å jobbe med <em>punktgrafikk</em> og <em>vektorgrafikk</em>. I punktgrafikk jobber vi med nettopp punktene (også kalt pikslene) i bildet. Typisk vil du gjøre dette med bilder du laster ned fra nettet. Med vektorgrafikk kan vi jobbe med direkte med linjer og former. Mange av figurene i Scratchbiblioteket bruker dette, og det er ofte bedre når vi skal tegne selv.</p> </section> </section> </section> <section class=activity id=steg-3-king-kong-flytter-seg> <h1 class=activity id=steg-3-king-kong-flytter-seg>Steg 3: King Kong flytter seg</h1> <p>Nå har vi tatt inn grafikken vi trenger. Det er på tide å begynne å programmere!</p> <section class=check id=sjekkliste-4> <h2 class=check id=sjekkliste-4>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_13><label for=cbx_13> La oss begynne med <code>skyskraper</code>-figuren. Denne er ganske enkel. Vi vil bare passe på at den står i ro midt på skjermen i en passende størrelse. Det kan vi gjøre med et skript som ligner dette:</label></p> <pre class=blocks>når grønt flagg klikkes\nsett størrelse til (200) %\nlegg øverst\ngå til x: (0) y: (-50)\n</pre> <p>Du må eksperimentere litt med tallene slik at de passer til din skyskrapergrafikk.</p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_14><label for=cbx_14> Neste steg er <strong>King Kong</strong>. Vi vil at han skal stå på skyskraperen, og at vi kan flytte ham fra høyre til venstre side og tilbake igjen med piltastene. Dette er heller ikke så veldig vanskelig. Du må sikkert forandre litt på tallene, men et lite skript som ser omtrent slik ut gjør jobben:</label></p> <pre class=blocks>når grønt flagg klikkes\ngå til x: (-45) y: (30)\nbytt drakt til [venstre v]\nfor alltid\n    hvis &lt;tast [pil venstre v] trykket?&gt;\n        gli (0.2) sekunder til x: (-45) y: (30)\n        bytt drakt til [venstre v]\n    slutt\n    hvis &lt;tast [pil høyre v] trykket?&gt;\n        gli (0.2) sekunder til x: (45) y: (30)\n        bytt drakt til [høyre v]\n    slutt\nslutt\n</pre> </li> </ul> </section> <section class=flag id=test-prosjektet> <h2 class=flag id=test-prosjektet>Test prosjektet</h2> <p><strong>Klikk på det grønne flagget.</strong></p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_15><label for=cbx_15> Er <code>kong</code> og skyskraperen bra plassert i forhold til hverandre?</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_16><label for=cbx_16> Flytter <strong>King Kong</strong> seg slik han skal når du trykker på piltastene?</label></p> </li> </ul> <p>Endre på figurene og skriptene slik at det ser bra ut!</p> </section> </section> <section class=activity id=steg-4-flyene-flyr> <h1 class=activity id=steg-4-flyene-flyr>Steg 4: Flyene flyr</h1> <p>Nå skal vi kopiere flyet vårt slik at vi har mange fly som flyr rundt skyskraperen.</p> <section class=check id=sjekkliste-5> <h2 class=check id=sjekkliste-5>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_17><label for=cbx_17> For å kopiere det ene flyet skal vi bruke det som kalles kloning for å lage nye fly med ujevne mellomrom. Lag først et skript som stadig lager nye fly:</label></p> <pre class=blocks>når grønt flagg klikkes\nskjul\nbegrens rotasjon [vend sideveis v]\nfor alltid\n    vent (tilfeldig tall fra (0.5) til (4)) sekunder\n    lag klon av [meg v]\nslutt\n</pre> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_18><label for=cbx_18> Om du kjører spillet ditt skjer det ikke noe spennende enda, fordi vi ikke har sagt hva alle flyklonene skal gjøre. La oss begynne med å la dem fly skrått over skjermen:</label></p> <pre class=blocks>når jeg starter som klon\npek i retning (45 v)\ngå til x: (-280) y: (-140)\nvis\ngjenta til &lt;(y-posisjon) &gt; [190]&gt;\n    gå (10) steg\nslutt\nslett denne klonen\n</pre> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_19><label for=cbx_19> Igjen må du justere tallene slik at de passer for deg. Vi vil at flyet skal fly slik at det kommer borti <code>kong</code> om han står på venstre side av skyskraperen, men vi vil ikke at flyet krasjer i skyskraperen selv (se bildet <a href=#introduksjon>øverst i oppgaven</a>).</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_20><label for=cbx_20> Om du vil kan du klikke på <code>drakter</code> og rotere flyet litt slik at det flyr i riktig retning.</label></p> <figure><img src='+l(3509)+' alt=""></figure> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_21><label for=cbx_21> Vi kan også få flyene til å komme fra begge retninger! Ved å bruke et tilfeldig tall kan vi bestemme om flyet kommer fra høyre eller venstre. Endre koden din slik at den blir som følger:</label></p> <pre class=blocks>når jeg starter som klon\nhvis &lt;(tilfeldig tall fra (1) til (2)) = [1]&gt;\n    pek i retning (45 v)\n    gå til x: (-280) y: (-140)\nellers\n    pek i retning (-45 v)\n    gå til x: (280) y: (-140)\nslutt\nvis\ngjenta til &lt;(y-posisjon) &gt; [190]&gt;\n    gå (10) steg\nslutt\nslett denne klonen\n</pre> </li> </ul> </section> </section> <section class=activity id=steg-5-king-kong-ma-passe-seg> <h1 class=activity id=steg-5-king-kong-ma-passe-seg>Steg 5: King Kong må passe seg</h1> <p>Oppgaven til <strong>King Kong</strong> er å passe seg slik at han ikke blir truffet av flyene.</p> <section class=check id=sjekkliste-6> <h2 class=check id=sjekkliste-6>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_22><label for=cbx_22> For at <code>kong</code> skal merke at han blir truffet av flyene lager vi et nytt skript på ham. Et enkelt utgangspunkt kan være:</label></p> <pre class=blocks>når grønt flagg klikkes\nfor alltid\n    vent til &lt;berører [fly v] ?&gt;\n    endre [farge v] effekt med (25)\n    vent (0.5) sekunder\n    ta bort grafiske effekter\nslutt\n</pre> <p>Her venter vi 0.5 sekunder både for at fargeeffekten skal synes og for at da har flyet passert slik at ikke King Kong blir truffet flere ganger av det samme flyet.</p> </li> </ul> <p>Vi har nå laget et ganske enkelt spill. Men det er flere ting du kan prøve på egen hånd! Nedenfor er noen forslag, men du har kanskje egne ideer til hvordan spillet kan videreutvikles?</p> <section class=try id=prov-selv> <h3 class=try id=prov-selv>Prøv selv</h3> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_23><label for=cbx_23> Legg til lydeffekter! Kanskje litt motorlyd fra flyene, og så klart trenger vi en lyd når King Kong blir truffet av flyene.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_24><label for=cbx_24> Tell poeng! Kanskje du kan få poeng for hvert fly som passerer?</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_25><label for=cbx_25> Tell liv! King Kong kan ikke bli truffet av flyene <code class=blockcontrol>for alltid</code>. Legg til en <code class=blockdata>liv</code>-variabel som teller hvor mange liv du har igjen. Kanskje <code>kong</code> ramler ned fra skyskraperen når han er tom for liv?</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_26><label for=cbx_26> Kan du utvide spillet? Kanskje kommer det fly i flere retninger og King Kong må dukke eller hoppe for å unngå dem? Kanskje King Kong kan fange flyene på en eller annen måte og få poeng for det?</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_27><label for=cbx_27> Kan du gjøre spillet vanskeligere etterhvert? For eksempel kan flyene komme raskere etterhvert som du får flere poeng?</label></p> </li> </ul> </section> </section> </section> '},3466:function(e,t){e.exports="data:image/png;base64,"},3506:function(e,t,l){e.exports=l.p+"_/oppgaver/src/scratch/kingkong/eksempel.1d47fa.png"},3507:function(e,t,l){e.exports=l.p+"_/oppgaver/src/scratch/kingkong/gronn_bakgrunn.d3378b.png"},3508:function(e,t,l){e.exports=l.p+"_/oppgaver/src/scratch/kingkong/kingkong.abbd0e.png"},3509:function(e,t,l){e.exports=l.p+"_/oppgaver/src/scratch/kingkong/roter_fly.5ebf0a.png"},3510:function(e,t,l){e.exports=l.p+"_/oppgaver/src/scratch/kingkong/tegn_bakgrunn.e4d39b.png"}});